import React from 'react';
import { Link } from 'react-router-dom';
import { Menu } from 'semantic-ui-react';


const Header = () => {
	return (
		<div class="ui secondary vertical menu">
  			<a class="active item" href="/">
   			 Registar
		</a>
			<a class="item" href="/employee">
				Employees
		</a>
		</div>
	)
}

export default Header;
